import { Layout, Page, TextStyle } from "@shopify/polaris";

const Index = () => (
    <Page primaryAction={{
        content: 'Select products',
    }}
    >
    <Layout>
        <TextStyle variation="subdued" >
            testing the polaris component
        </TextStyle>
    </Layout>
</Page>
);

export default Index;
